div.p:
c
RootSet collect_roots(GC* gc) {
RootSet roots = {0};

pre.code:
// 1. Scan stack
scan_stack(gc, &roots);

// 2. Scan globals
scan_globals(gc, &roots);

// 3. Scan registers
scan_registers(gc, &roots);

// 4. Scan TLS (if multi-threaded)
if (gc->multi_threaded) {
    scan_tls(gc, &roots);
}

// 5. Deduplicate
deduplicate_roots(&roots);

return roots;

